import React from "react";
import { Link, Switch, Route, useRouteMatch } from "react-router-dom";

import "../css/Navigation.css";

import Home from "../route/Home";
import Menu from "../route/Menu";
import Reservation from "../route/Reservation";
import Hours from "../route/Hours";

const Navigation = () => {
  let match = useRouteMatch();
  return (
    <div id="navigationContainer">
      <div id="linkContainer">
        <Link class="links" to={`/admin/home`}>
          Home
        </Link>
        <Link class="links" to={`/admin/menu`}>
          Menu
        </Link>
        <Link class="links" to={`/admin/reservation`}>
          Reservation
        </Link>
        <Link class="links" to={`/admin/hours`}>
          Hours
        </Link>
      </div>
      <div id='mainContainer'>
        <div id='topNavigation'>
            <button>logout</button>
        </div>
        <Switch>
          <Route path={"/admin/home"} component={Home} />
          <Route path={"/admin/menu"} component={Menu} />
          <Route path={"/admin/reservation"} component={Reservation} />
          <Route path={"/admin/hours"} component={Hours} />
        </Switch>
      </div>
    </div>
  );
};

export default Navigation;
